import React from 'react';
import ReactDOM from 'react-dom';

const date= new Date();
const cHour= date.getHours();

if (cHour>=1 && cHour<=11) {
   ReactDOM.render(
      <>
       <p>Good Morning</p>
      </>
       , document.getElementById("root")
     );}

else if (cHour>=12 && cHour<=17) {
   ReactDOM.render(
      <>
       <p>Good Afternoon</p>
      </>
       , document.getElementById("root")
     );}

else {
   ReactDOM.render(
      <>
       <p>Good Night</p>
      </>
       , document.getElementById("root")
     );
}
